:root {
  --font-color: #fff;
  --background-color: #4339b0;
}

.lf-wrapper {
  border-radius: 3px 3px 20px 20px;
  border: 20px solid var(--background-color);
}

.lf-header, .lf-main, .lf-footer {
  background-color: var(--background-color);
  text-align: center;
}

.lf-header, .lf-footer {
  vertical-align: middle;
  color: var(--font-color);
}

.lf-header-logo {
  height: 100%;
}

.lf-footer {
  line-height: 60px;
}
